import { Box } from "@mui/system";
import Navbar from "./Navbar";
import bicicleta from './imagenes/monseny.jpg';


function DetalleReserva (){
    return(
        <Box style={{height: '100vh'}}>
            <Navbar />
            <p> Home > Montaña > Bicicleta </p>
            <h3>Paseo en bicicleta por el Montseny</h3>
          <Box style={{display:'flex'}}>  
              <img src={bicicleta} alt="imagen de bicicleta"/>
              <aside>
                  <p>Disfruta de un hermoso paseo en bicicleta por el increíble Parque Natural del Montseny. Una escapada veraniega perfecta para parejas, familias y amigos que nos permitirá conocer nuevos y sorprendentes lugares. El recorrido que os proponemos comienza con una larga subida con algunos descansos, combinando asfalto y pistas anchas, culminando en un mirador con magníficas vistas del Vallés y el mar. Desde aquí continuaremos la bajada combinando senderos, pistas y algún tramo de carretera y terreno mixto para visitar la zona de Santa Fe, donde descubriremos la Ermita y el Bosque de las Secuoyas. Para finalizar, acudiremos al restaurante María Rosa de Palautordera, donde disfrutaremos de una excelente comida casera con butifarra blanca y negra y munxetes del Montseny.</p>
              </aside>
          </Box>  
        </Box>

    )
}

export default DetalleReserva;
